import { StatusBar } from 'expo-status-bar';
import React, { useEffect } from 'react';
import { SafeAreaProvider } from 'react-native-safe-area-context';
import { NavigationContainer } from '@react-navigation/native';
import AppNavigator from './src/navigation/AppNavigator';
import { AuthProvider } from './src/contexts/AuthContext';
import { ApiProvider } from './src/contexts/ApiContext';
import AsyncStorage from '@react-native-async-storage/async-storage';

export default function App() {
  useEffect(() => {
    const setupDevBypass = async () => {
      // Dados fict√≠cios para bypass de login
      const mockUser = JSON.stringify({
        id: 1,
        username: 'teste',
        email: 'teste@example.com',
        role: 'admin'
      });
      const mockToken = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6MSwidXNlcm5hbWUiOiJ0ZXN0ZSJ9';

      await AsyncStorage.setItem('@CranialApp:user', mockUser);
      await AsyncStorage.setItem('@CranialApp:token', mockToken);
    };

    setupDevBypass();
  }, []);

  return (
    <SafeAreaProvider>
      <StatusBar style="auto" />
      <AuthProvider>
        <ApiProvider>
          <NavigationContainer>
            <AppNavigator />
          </NavigationContainer>
        </ApiProvider>
      </AuthProvider>
    </SafeAreaProvider>
  );
}
